import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import View from './pages/View';

function App() {
  return (
    <BrowserRouter>
    <Routes></Routes>
      <Route path="/" element={Home} />
      <Route path="view" element={View} />
    </BrowserRouter>
  );
}

export default App;
